import React from 'react';

const styles = {
    footerStyle: {
        background: '#8080805e',
        height: '50px'
    },
    footingStyle: {
        fontSize: '100px',
    },
};

function Footer() {
    return (
        <footer style={styles.footerStyle} className="footer">
            <h5> Footer</h5>
            <p>Social Icons Here</p>
        </footer>
    )
}

export default Footer;
